/* http://meyerweb.com/eric/tools/css/reset/
   v2.0b1 | 201101
   NOTE: WORK IN PROGRESS
   USE WITH CAUTION AND TEST WITH ABANDON */
   *,
   *::before,
   *::after {
       box-sizing: border-box;
       font-family: NotoSansKR !important;
       font-weight: 300;
   }

   html,
   body,
   div,
   span,
   applet,
   object,
   iframe,
   h1,
   h2,
   h3,
   h4,
   h5,
   h6,
   p,
   blockquote,
   pre,
   a,
   abbr,
   acronym,
   address,
   big,
   cite,
   code,
   del,
   dfn,
   em,
   img,
   ins,
   kbd,
   q,
   s,
   samp,
   small,
   strike,
   strong,
   sub,
   sup,
   tt,
   var,
   b,
   u,
   i,
   center,
   dl,
   dt,
   dd,
   ol,
   ul,
   li,
   fieldset,
   form,
   label,
   legend,
   table,
   caption,
   tbody,
   tfoot,
   thead,
   tr,
   th,
   td,
   article,
   aside,
   canvas,
   details,
   figcaption,
   figure,
   footer,
   header,
   hgroup,
   menu,
   nav,
   section,
   summary,
   time,
   mark,
   audio,
   video {
       padding: 0;
       border: 0;
       margin: 0;
       font: inherit;
       font-family: 'NotoSansKR';
       font-size: 100%;
       outline: 0;
       vertical-align: baseline;
   }

   /* HTML5 display-role reset for older browsers */
   article,
   aside,
   details,
   figcaption,
   figure,
   footer,
   header,
   hgroup,
   menu,
   nav,
   section {
       display: block;
   }

   body {
       line-height: 1;
   }

   ol,
   ul {
       list-style: none;
   }

   blockquote,
   q {
       quotes: none;
   }

   blockquote::before,
   blockquote::after,
   q::before,
   q::after {
       content: '';
       content: none;
   }

   /* remember to define visible focus styles!
      :focus{outline:?????;}
      */

   /* remember to highlight inserts somehow! */
   ins {
       text-decoration: none;
   }

   del {
       text-decoration: line-through;
   }

   table {
       border-collapse: collapse;
       border-spacing: 0;
   }

   h1,
   h2,
   h3,
   h4,
   h5,
   h6,
   strong {
       font-weight: normal;
   }

   a {
       display: inline-block;
       color: #000;
       text-decoration: none;
   }

   img {
       display: block;

       // vertical-align: top;
   }

   a:link,
   a:visited,
   a:active {
       text-decoration: none;
   }

   caption,
   legend {
       display: none;
   }

   button {
       box-sizing: border-box;
       padding: 0;
       border: 0;
       margin: 0;
       background: none;
   }

   em {
       font-style: normal;
   }

   .hidden {
       position: absolute;
       overflow: hidden;
       width: 1px;
       height: 1px;
       clip: rect(0 0 0 0);
       clip-path: inset(50%);
       white-space: nowrap;
   }

   // App.module.scss reset
   #root [class*="sol-transition-wrap"] {
       width: 100%;
       text-align: left;

       // height: auto;
   }

   ::-webkit-scrollbar {
       display: none !important;
       width: 0 !important;
   }

   :focus {
       outline: none;
   }

   input, textarea, button {
       appearance: none;
       -moz-appearance: none;
       -webkit-appearance: none;
       border-radius: 0;
       -webkit-border-radius: 0;
       -moz-border-radius: 0;
   }
